import './App.css';
import SignUp from './components/signup/SignUp';
import bg from './assets/img/bg.jpg'
import Navbar from './components/header/Navbar';
function App() {
  return (
    <div style={{ backgroundImage: `url(${bg})`, backgroundRepeat: 'no-repeat ', backgroundSize: 'cover' }}>
      <Navbar/>
      <SignUp/>
    </div>
  );
}

export default App;
